import React from "react";
import { NavLink } from "react-router-dom";

function Header() {
  const activeStyle1 = { color: 'orange' };
  return (
  <nav>
    <NavLink activeStyle={activeStyle1} to="./" >
      Home
    </NavLink>
    {" | "}  

    <NavLink activeStyle={activeStyle1} to="./courses" >
      Courses
    </NavLink>
    {" | "}

    <NavLink activeStyle={activeStyle1} to="./About" >
      About
    </NavLink>
  </nav>  
  )
}

export default Header;
